sourcesContent:
import { Product } from "models/Product";
import { User } from "models/User";

export const cartService = {
  async getCart(payload) {
    const cart = await User.findById(payload);
    return cart;
  },
  async addCart(payload) {
    const newProduct = new User.cart();
    newProduct.nameProduct = payload.nameProduct;
    newProduct.price = payload.price;
    newProduct.status = payload.status;
    newProduct.category = payload.category;
    newProduct.image = payload.image;
    newProduct.quantity = payload.quantity;
    return await newProduct.save();
  },
};

